import React, { Component } from 'react';
import {Link} from 'react-router-dom'
class CustomerDataTr extends Component {
    render() {
        var { customer } = this.props;
        return (

            <tr>
                <td>
                    <Link to="/" className="margin-right20">
                        <Button type="submit" className="btn btn-primary btn-cons" variant="contained" color="primary">
                        <i className="material-icons">arrow_back</i>
                        </Button>	
                    </Link>
                    {customer.id}
                </td>
                <td>{customer.created_at}</td>	
                <td>{customer.transaction_id}</td>
                <td>{customer.category.title}</td>
                <td>{customer.user_id}</td>
                <td>{customer.note}</td>
            </tr>

        );
    }
}

export default CustomerDataTr;
